window.bookSummaryJSON = "<p>Death's grip is strong, but my will is stronger.</p> <p>Revelations, loss, and chaos loom. But like always, I'm not about to let any of that keep me down.</p> <p>I'm a woman of action who believes in solutions, except the losses that challenge me now may not have quick fixes.</p> <p>I'll have to give up more to regain what is lost. Make new promises to keep the people I love.</p> <p>And when it's all said and done, even that may not be enough.</p> <p>The storm that's been brewing is hurtling toward us, and this time I'm not sure there is a tether that can keep us grounded.</p> <p>Contains mature themes.</p>"; 
